 \"\", \"tbfz\");\r\n\r\nif (!$link) {\r\n    echo \"Ошибка: Невозможно установить соединение с MySQL.\" . PHP_EOL;\r\n    echo \"Код ошибки errno: \" . mysqli_connect_errno() . PHP_EOL;\r\n    echo \"Текст ошибки error: \" . mysqli_connect_error() . PHP_EOL;\r\n    exit;\r\n}\r\n\r\n// Attempt select query execution\r\n$sql = \"SELECT machine.`machine_id`, count(failure.machine_id) \r\nFROM machine, failure \r\nWHERE failure.`machine_id` = machine.`machine_id` group by machine.`machine_id`\";\r\n\r\n$sqlW = \"SELECT worker.`fullname`, count(failure.worker_id)\r\n	FROM worker, failure \r\n	WHERE failure.`worker_id` = worker.`worker_id` \r\n	group by worker.`fullname`\";\r\n\r\n$sqlC = \"SELECT failure_cause.`category`, 	count(failure.failure_cause_id) \r\n	FROM failure_cause, failure \r\n	WHERE failure.`failure_cause_id` = failure_cause.`failure_cause_id` \r\n	group by failure_cause.`category`\";\r\n\r\n$sqlS = \"SELECT failure_cause.`category`, count(failure.failure_cause_id)\r\n	FROM failure_cause, failure \r\n	WHERE failure.`failure_cause_id` = failure_cause.`failure_cause_id` AND failure.`machine_id` = 1 \r\n	group by failure_cause.`category`\";\r\n\r\n$labels = array();\r\n$data = array();\r\nif($result = mysqli_query($link, $sql)){\r\n    if(mysqli_num_rows($result) > 0){      \r\n		$i = 0;\r\n		while($row = mysqli_fetch_array($result)){\r\n			$labels[$i] = $row[0];\r\n			$data[$i] = $row[1];\r\n			$i++;\r\n        }\r\n\r\n        // Free result set\r\n        mysqli_free_result($result);\r\n    } else{\r\n        echo \"No records matching your query were found.\";\r\n    }\r\n} else{\r\n    echo \"ERROR: Could not able to execute $sql. \" . mysqli_error($link);\r\n}\r\n\r\n$labelsW = array();\r\n$dataW = array();\r\nif($result = mysqli_query($link, $sqlW)){\r\n    if(mysqli_num_rows($result) > 0){      \r\n		$i = 0;\r\n		while($row = mysqli_fetch_array($result)){\r\n			$labelsW[$i] = $row[0];\r\n			$dataW[$i] = $row[1];\r\n			$i++;\r\n        }\r\n\r\n        // Free result set\r\n        mysqli_free_result($result);\r\n    } else{\r\n        echo \"No records matching your query were found.\";\r\n    }\r\n} else{\r\n    echo \"ERROR: Could not able to execute $sql. \" . mysqli_error($link);\r\n}\r\n\r\n$labelsC = array();\r\n$dataC = array();\r\nif($result = mysqli_query($link, $sqlC)){\r\n    if(mysqli_num_rows($result) > 0){      \r\n		$i = 0;\r\n		while($row = mysqli_fetch_array($result)){\r\n			$labelsC[$i] = $row[0];\r\n			$dataC[$i] = $row[1];\r\n			$i++;\r\n        }\r\n\r\n        // Free result set\r\n        mysqli_free_result($result);\r\n    } else{\r\n        echo \"No records matching your query were found.\";\r\n    }\r\n} else{\r\n    echo \"ERROR: Could not able to execute $sql. \" . mysqli_error($link);\r\n}\r\n\r\n$labelsS = array();\r\n$dataS = array();\r\nif($result = mysqli_query($link, $sqlS)){\r\n    if(mysqli_num_rows($result) > 0){      \r\n		$i = 0;\r\n		while($row = mysqli_fetch_array($result)){\r\n			$labelsS[$i] = $row[0];\r\n			$dataS[$i] = $row[1];\r\n			$i++;\r\n        }\r\n\r\n        // Free result set\r\n        mysqli_free_result($result);\r\n    } else{\r\n        echo \"No records matching your query were found.\";\r\n    }\r\n} else{\r\n    echo \"ERROR: Could not able to execute $sql. \" . mysqli_error($link);\r\n}\r\n// Close connection\r\nmysqli_close($link);\r\n?>\r\n\r\n<!-- Начало html -->\r\n<div id=\"wrap\">\r\n	<form action=\"handler.php\">\r\n		<p><input name=\"charts\" type=\"radio\" value=\"full\" checked> Общая аналитика</p>\r\n		<p><input name=\"charts\" type=\"radio\" value=\"spec\"> Аналитика по станку</p>\r\n		<select id=\"machine-select\">\r\n			<?php\r\n\r\n				$link = mysqli_connect(\"127.0.0.1\", \"root\", \"\", \"tbfz\");\r\n\r\n				if (!$link) {\r\n					echo \"Ошибка: Невозможно установить соединение с MySQL.\" . PHP_EOL;\r\n					echo \"Код ошибки errno: \" . mysqli_connect_errno() . PHP_EOL;\r\n					echo \"Текст ошибки error: \" . mysqli_connect_error() . PHP_EOL;\r\n					exit;\r\n				}\r\n\r\n				// Attempt select query execution\r\n				$sql = \"SELECT machine_id FROM machine\";\r\n\r\n				if($result = mysqli_query($link, $sql)){\r\n					if(mysqli_num_rows($result) > 0){      \r\n\r\n						while($row = mysqli_fetch_array($result)){\r\n							echo \'<option>\'.$row[0].\'</option>\';						\r\n						}\r\n\r\n						// Free result set\r\n						mysqli_free_result($result);\r\n					} else{\r\n						echo \"No records matching your query were found.\";\r\n					}\r\n				} else{\r\n					echo \"ERROR: Could not able to execute $sql. \" . mysqli_error($link);\r\n				}\r\n				\r\n				// Close connection\r\n				mysqli_close($link); ?>\r\n		</select>\r\n	</form> \r\n	\r\n	<div id=\"full\" class=\"chart-block\">	\r\n		<canvas id=\"machine-chart\" class=\"chart\"></canvas><br><br>\r\n		<canvas id=\"workers-chart\" class=\"chart\"></canvas><br><br>\r\n		<canvas id=\"causes-chart\" class=\"chart\"></canvas><br><br>	\r\n		<form action=\"handler.php\">\r\n			<p><input name=\"chart-type\" type=\"radio\" value=\"machine-chart\" checked> По станкам</p>\r\n			<p><input name=\"chart-type\" type=\"radio\" value=\"workers-chart\"> По работникам</p>\r\n			<p><input name=\"chart-type\" type=\"radio\" value=\"causes-chart\"> По причинам</p>\r\n		</form>\r\n	</div>\r\n	<div id=\"spec\" class=\"chart-block\">	\r\n		<canvas id=\"spec-chart\"></canvas><br><br>\r\n	</div>\r\n	<div id=\"a\"></div>	\r\n	<button type=\"button\" onclick=\"exp()\">Экспорт в png</button>\r\n</div>\r\n<!-- Конец html -->\r\n\r\n<script lang=\"javascript\">\r\n\r\n	 var cont = \"\";\r\n	 var currentChart = \"machine-chart\";\r\n	\r\n	 //обработка выбора станка в списке\r\n	 $(\'select\').on(\'change\', function() {\r\n		//передаем id станка в php\r\n		var curMachine = this.value;\r\n		$(\'#a\').load(\"wp-content/dbc.php\", {\r\n			currentMachine: curMachine\r\n		});	\r\n	 });\r\n	 \r\n	 //получение данных после подгрузки из бд\r\n	 $(\'body\').on(\'DOMSubtreeModified\', \'#a\', function(){\r\n		cont = $(\"#a\").text();\r\n		var i = cont.indexOf(\'|\');\r\n		\r\n		var labels = cont.substring(0,i);\r\n		var data = cont.substring(i+1,cont.length);\r\n		\r\n		var labelsArray = labels.split(\',\');\r\n		var dataArray = data.split(\',\');\r\n		\r\n		plot(\'spec-chart\', labelsArray, dataArray, \'Кол-во остановок по категории\', \'pie\');\r\n	});\r\n\r\n	 //скрываем график станка\r\n	 $(\'.chart-block\').not(\"#full\").hide(0);\r\n	 \r\n	 //скрываем все графики кроме графика по станкам\r\n	 $(\'.chart\').not(\"#machine-chart\").hide(0);\r\n	 \r\n	 //скрываем выбор графика\r\n	 $(\'#machine-select\').hide(0);\r\n	 \r\n	 //скрываем блок подгузки из бд\r\n	 $(\'#a\').hide(0);\r\n	 \r\n	 //radio-button для общей/частной статистики\r\n	 $(\'input[name=\"charts\"]\').click(function(){\r\n		var target = $(\"#\" + $(this).val());\r\n		\r\n		if ($(this).val() == \"spec\") {\r\n			currentChart = \"spec-chart\";\r\n			$(\'#machine-select\').show(0);\r\n		} else {\r\n			$(\'#machine-select\').hide(0);\r\n		}\r\n			\r\n		$(\'.chart-block\').not(target).hide(0);\r\n		target.fadeIn(500);\r\n	 });\r\n	 \r\n	 //radio-button для вида графика\r\n	 $(\'input[name=\"chart-type\"]\').click(function(){\r\n		var target = $(\"#\" + $(this).val());\r\n \r\n		currentChart = $(this).val();\r\n		$(\'.chart\').not(target).hide(0);\r\n		target.fadeIn(500);\r\n	 });\r\n	\r\n	 //графики только на главной странице\r\n	  if (window.location.href != \"http://localhost/\") {\r\n		  $(\'#wrap\').css(\"display\",\"none\");\r\n	  }\r\n	  \r\n	  plot(\'machine-chart\', <?php echo json_encode($labels ); ?> , <?php echo json_encode($data ); ?>, \'Кол-во остановок у станка\', \'bar\');\r\n   	  plot(\'workers-chart\', <?php echo json_encode($labelsW ); ?> , <?php echo json_encode($dataW ); ?>, \'Кол-во остановок у работника\', \'bar\');\r\n	  plot(\'causes-chart\', <?php echo json_encode($labelsC ); ?> , <?php echo json_encode($dataC ); ?>, \'Кол-во остановок по категории\', \'bar\');