  `tags` longtext COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
  `scope` varchar(15) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'global',
  `priority` smallint(6) NOT NULL DEFAULT 10,
  `active` tinyint(1) NOT NULL DEFAULT 0,
  `modified` datetime NOT NULL DEFAULT '0000-00-00 00:00:00'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

--
-- Дамп данных таблицы `tbfz_snippets`
--

INSERT INTO `tbfz_snippets` (`id`, `name`, `description`, `code`, `tags`, `scope`, `priority`, `active`, `modified`) VALUES
(1, 'Пример HTML шорткода', 'Это примр сниппета, демонстрирующий как добавить HTML шорткод.\n\nВы можете удалить это, отредактировать или добавить собственное содержимое.', '\nadd_shortcode( \'shortcode_name\', function () {\n\n	$out = \'<p>Напишите содержимое HTML шорткода здесь</p>\';\n\n	return $out;\n} );', 'shortcode', 'global', 10, 0, '2020-11-17 18:27:12'),
(2, 'Пример сниппета CSS', 'Это примр сниппета, демонстрирующий как добавить CSS шорткод.\n\nВы можете удалить это, отредактировать или добавить собственное содержимое.', '\nadd_action( \'wp_head\', function () { ?>\n<style>\n\n	/* Напишите CSS код здесь */\n\n</style>\n<?php } );\n', 'css', 'front-end', 10, 0, '2020-11-17 18:27:12'),
(3, 'Пример сниппета JavaScript', 'Это примр сниппета, демонстрирующий как добавить JavaScript код на сайт.\r\n\r\nВы можете удалить это, отредактировать или добавить собственное содержимое.', 'add_action( \'wp_head\', function () { ?>\r\n<script>\r\n	alert(\'lol\');\r\n	/* Напишите JS код здесь */\r\n\r\n</script>\r\n<?php } );\r\n', 'javascript', 'front-end', 10, 0, '2020-11-17 18:38:29'),
(4, 'Упорядочить сниппеты по имени', 'Упорядочить сниппеты по умолчанию по имени в таблице сниппетов.', '\nadd_filter( \'code_snippets/list_table/default_orderby\', function () {\n	return \'name\';\n} );\n', 'code-snippets-plugin', 'admin', 10, 0, '2020-11-17 18:27:12'),
(5, 'Упорядочить сниппеты по дате', 'По умолчанию упорядочить стиппеты по дате последнего изменения в таблице сниппетов.', '\nadd_filter( \'code_snippets/list_table/default_orderby\', function () {\n	return \'modified\';\n} );\n\nadd_filter( \'code_snippets/list_table/default_order\', function () {\n	return \'desc\';\n} );\n', 'code-snippets-plugin', 'admin', 10, 0, '2020-11-17 18:27:12');

