(4, 'worker_failures', 1, 'mysql', 'SELECT worker.`fullname`, count(failure.worker_id) FROM worker, failure WHERE failure.`worker_id` = worker.`worker_id` group by worker.`fullname`\n\n', 1, 0, 1, 1, 1, 0, 0, 0, '', '', 0, 0, 10, 10, 0, 0, 0, 0, 1, 1, '', '', '', 'a:5:{s:5:\"print\";i:1;s:4:\"copy\";i:1;s:5:\"excel\";i:1;s:3:\"csv\";i:1;s:3:\"pdf\";i:0;}', '{\"info_block\":1,\"global_search\":1,\"showRowsPerPage\":1,\"showAllRows\":0,\"clearFilters\":0,\"simpleResponsive\":0,\"simpleHeader\":0,\"stripeTable\":0,\"cellPadding\":10,\"verticalScroll\":0,\"verticalScrollHeight\":600}', ''),
(5, 'category_failures', 1, 'mysql', 'SELECT failure_cause.`category`, count(failure.failure_cause_id) \nFROM failure_cause, failure \nWHERE failure.`failure_cause_id` = failure_cause.`failure_cause_id` \ngroup by failure_cause.`category`\n\n', 1, 0, 1, 1, 1, 0, 0, 0, '', '', 0, 0, 10, 0, 0, 0, 0, 0, 1, 1, '', '', '', 'a:5:{s:5:\"print\";i:1;s:4:\"copy\";i:1;s:5:\"excel\";i:1;s:3:\"csv\";i:1;s:3:\"pdf\";i:0;}', '{\"info_block\":1,\"global_search\":1,\"showRowsPerPage\":1,\"showAllRows\":0,\"clearFilters\":0,\"simpleResponsive\":0,\"simpleHeader\":0,\"stripeTable\":0,\"cellPadding\":10,\"verticalScroll\":0,\"verticalScrollHeight\":600}', '');

